INSERT INTO TipoEmissao(nome, descricao, nocividade) VALUES('CO₂', 'Gás Carbônico: Proveniente da queima de combustíveis fósseis, queimadas e desmatamentos', 1);
INSERT INTO TipoEmissao(nome, descricao, nocividade) VALUES('CH₄', 'Gás Metano: Componente primário do gás natural, também produzido por bactérias no aparelho digestivo do gado, aterros sanitários, plantações inundadas, mineração e queima de biomassa', 10.435483871);
INSERT INTO TipoEmissao(nome, descricao, nocividade) VALUES('N₂O', 'Óxido Nitroso: Liberado por microorganismos no solo (por um processo denominado nitrificação, que libera igualmente nitrogênio)', 196.129032258);
INSERT INTO TipoEmissao(nome, descricao, nocividade) VALUES('CHF₃', 'Trifluorometano: Formado na baixa atmosfera, sob estímulo do sol, a partir de óxidos de nitrogênio (NOx) e hidrocarbonetos produzidos em usinas termoelétricas, pelos veículos, pelo uso de solventes e pelas queimadas', 10083.870967742);
INSERT INTO TipoEmissao(nome, descricao, nocividade) VALUES('CH₂F₂', 'Difluorometano: Emitido em alguns processos industriais e também na durante a produção de refrigeradores, ar-condicionados e espuma para preenchimento de estofados', 333.870967742);
INSERT INTO TipoEmissao(nome, descricao, nocividade) VALUES('SF₆', 'Hexafluorido de Enxofre: Amplamente utilizado em equipamentos elétricos de alta tensão pela sua alta capacidade de isolmaneot elétrico. Contribui para o efeito estufa por ser altamente reflexiva', 32525.806451613);
INSERT INTO TipoEnergia(nome, descricao) VALUES('Nuclear', 'Energia gerada a partir de usinas nucleares');
INSERT INTO TipoEnergia(nome, descricao) VALUES('Eólica',  'Energia gerada a partir dos ventos');
INSERT INTO TipoEnergia(nome, descricao) VALUES('Solar', 'Energia gerada a partir de placas solares que capturam a luz do sol');
INSERT INTO TipoEnergia(nome, descricao) VALUES('Hidrelétrica', 'Energia gerada a partir das correntes da água');
INSERT INTO TipoEnergia(nome, descricao) VALUES('Biomassa', 'Energia gerada a partir da queima de matérias orgânicas');
INSERT INTO TipoEnergia(nome, descricao) VALUES('Combustíveis Fósseis', 'Energia gerada a partir da queima de materiais derivados de petróleo');
INSERT INTO TipoImpacto(nome, descricao) VALUES('Poluição Atmosférica', 'Contaminação do ar por partículas sólidas, líquidas e gasosas, que podem ser produzidas artificialmente, através das atividades humanas, ou de fontes naturais');
INSERT INTO TipoImpacto(nome, descricao) VALUES('Poluição da Água', 'Contaminação dos recursos hídricos através de elementos biológicos, físicos e químicos que causam danos e são extremamente prejudiciais aos seres vivos, afetando diretamente os fluviais, a fauna e a flora');
INSERT INTO TipoImpacto(nome, descricao) VALUES('Poluição Térmica', 'Aumento ou diminuição da temperatura das águas naturais, causando impacto direto nos seres vivos desse ecossistema. A principal causa é a refrigeração ou aquecimento de usinas nucleares, centrais elétricas e grandes fábricas, que acabam por liberar vapores e/ou efluentes a altas temperaturas');
INSERT INTO TipoImpacto(nome, descricao) VALUES('Poluição do Solo e Subsolo', 'Ocorre pelo contato de resíduos sólidos, líquidos, efluentes e produtos químicos e poluentes com a superfície do solo, podendo penetrar no mesmo e atingir, inclusive, o subsolo e lençol freático');
INSERT INTO TipoImpacto(nome, descricao) VALUES('Poluição Luminosa', 'Se dá pela grande quantidade de luz artificial que é projetada pelas cidades e irradia áreas de maneira inapropriada');
